const App = () => {
  return (
      <BrowserRouter>
        <Router state={state} findAdById={findAdById} getCategoryAndSubCategoryBySubId={getCategoryAndSubCategoryBySubId} findUserByUsername={findUserByUsername}/>
      </BrowserRouter>
  );
}

export default App;
